import React, {useContext} from 'react'
import { Link } from 'react-router-dom'


const Header = () => {
  let {name} = useContext(Aut)
  return (
    <div>
        <Link to="/"> Home</Link>
        <span> | </span>
        <Link to="/login"> Login</Link>

        <p> Welcome {name} </p>

    </div>
  )
}

export default Header
